scriptlet.script:
try {
	var srvs = Object.keys(JSON.parse(serverList));
	var ips = Object.keys(JSON.parse(ipPool));
	var requestedItems = (resourcing == "IPAM")? srvs.length : 0;
	requestedItems += ips.length;
	if(requestedItems > 0) {
		scriptletContext.put("requestedItems",requestedItems);
		scriptletResponse="Yes";
	}
	else {
		scriptletResponse="No";
	}
}
catch(Error) {
	scriptletResponse="failure";
	scriptletContext.put("FailureMessage","Requires IPAM: " + Error);
}
